import React from 'react'
import '../styleSheets/inlineCSS.css'
import '../styleSheets/inlineCSS2.css'
import style from '../styleSheets/sample1.module.css'

{/* Using module css files */}


const header = {
    borderStyle: 'solid',
    borderColor: 'black',
    borderWidth: '2px',
    backgroundColor: 'yellow'
}

function InlineCss(props) {

    let cssClassName = props.primary? 'primary': ''
    return (
    <div className = {`${cssClassName} secondary`} style = {header}>Inline Css</div>
  )
}

export default InlineCss
